def isSubsequence(s: str, t: str) -> bool:
    if len(s) > len(t):
        return False
    if s == "":
        return True
    l, r = 0, 0
    while r < len(t):
        if l == len(s) - 1 and s[l] == t[r]:
            return True
        if s[l] == t[r]:
            l += 1
            r += 1
        r += 1
    return False

case1 = ["bcd", ""]

print(isSubsequence(*case1))